const express = require("express");
const router = express.Router();

const auth = require("../middlewares/authMiddleware");
const role = require("../middlewares/roleMiddleware");

const {
  getAdminSummaryStats,
  getListingsByTypeStats,
  getListingsTrendStats
} = require("../controllers/adminDashboardController");

router.get("/summary", auth, role("admin"), getAdminSummaryStats);
router.get("/listings-by-type", auth, role("admin"), getListingsByTypeStats);
router.get("/listings-trends", auth, role("admin"), getListingsTrendStats);

module.exports = router;
